import React from 'react';
import {BrowserRoute, Link, NavLink} from "react-router-dom";
import SignedInLinks from './SignedInLinks'



const Navbar = () => {
 return (
        <nav className= "nav-wrapper red darken-3">
            <div className="container">
                <a className="brand-logo">Varausjärjestelmä</a>
            <ul className="right">
             <Link to='/'>Koti</Link>
                <Link to='/'> Kuvat</Link>
                <Link to='/Mökki'> Mökki</Link>
                <Link to='/Peräkärry'> Kärry</Link>
                <Link to='/Ruohonleikkuri'> Leikkuri</Link>
            </ul>
            </div>
        </nav>
    );
};
